  input: TEXT,F3XN,,"Receipts from a national committee were from joint fundraising
    activities and as such, these funds are not restricted for use as the federal
    component of an expenditure or disbursement allocated between Federal and Levin
    funds. Federal funds transferred from national party committees or other State,
    district or local party committees are not used as the Federal component of an
    expenditure or disbursement for Federal Election Activity.  Transfers from joint
    fundraising representatives reflect receipts from the joint fundraiser during
    the reporting period.  The joint fundraiser may provide memo information for Schedule
    A in reporting periods other than the current reporting period.  For employees
    who worked more than 25% of their time in any month on Federal Election Activity,
    their compensation and related payroll load are reported on Schedule B for the
    reporting period.  For employees who did not work more than 25% of their time
    in any month on Federal Election Activity, their compensation and related payroll
    load are reported on Schedule H4 for the reporting period.  For the reporting
    period no goods or services were contributed in-kind.  Payments to individuals
    are for the matters noted in the description line (i.e. rent, office cleaning,
    etc.) whereas reimbursements to individuals such as employees or volunteers for
    goods or services are described as reimbursement and are itemized regardless of
    amount."
